import React, {Component} from 'react'
import logoimg from '../img/logo.svg'
import 'bootstrap/dist/css/bootstrap.min.css'

class Logo extends Component {
    render() {
        return (
            <a href="#">Powered by: <img src={logoimg} style={logoStyle} alt='Visit Creator`s site' placeholder='jhjllk'/></a>
        )
    }
}
const logoStyle = {
    textDecoration: 'none'
}
export default Logo
